INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(3, 1, 'I almost married my high school sweetheart. She was a sharp girl. Very kind. Long brown hair, slim-- the whole package. We moved to California together after graduation. We spent all our time together. We were in love. We even talked about marriage several times. Then one morning she decided she didn’t want to do it anymore. She told me things had changed. It destroyed me. Ever since then, she’s been the one that I’ve always wondered about. I actually saw her a couple years ago. She came to New York for her father’s funeral, and we took a walk in Central Park together. I hadn’t seen her in forty-five years. She looked amazing. Exactly the same as I remembered. She had two kids. She’d gotten married to some guy from Yale. Toward the end of our walk, she told me that if she could do it all over again, she probably would have never married the guy. I said: ‘That breaks my heart, because all these years I imagined you were happy.’ Of course, there might have been a small part of me that was thinking: ‘Haha! You married the wrong guy.', 'The Real Winner\r\n', , 'Tragic', 'California', 321);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(4, 3, 'A really bad divorce triggered the first and only manic episode of my life. It was my body’s attempt to avoid feeling any pain. I was sleeping three hours a night and doing handstands in the morning. I did a whole lot of writing. I’m a contractor-- so I taught myself all sorts of plastering techniques and developed an entire series of finishes. I worked as a carpenter for twelve hours every day. Eventually I pushed myself to the point where I injured my shoulder, and the doctor told me that I couldn’t work anymore. It forced me to slow down, confront the illness, and make friends with that part of myself. Now I’m on a mood stabilizer. I’m not operating in a triggered state anymore. And I’m back to work, but this time with a team of people to help me carry the load.', 'A Catastrophic Divorce', , 'Motivational', 'New York', 301);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(5, 3, 'My mom and I have always been close. But we had to learn how to communicate again after my dad died. It took therapy. We’d stopped being honest with each other. My dad’s illness had been so stressful that we didn’t want to create any additional worries. So we tried to protect each other. Neither of us would admit if we were having a bad day. Or if we were feeling depressed. The answer to everything was always: ‘I’m fine.’ But we weren’t fine. And it was obvious. So we worried about each other all the time. It caused a lot of stress and arguments. We had to relearn how to admit when we were having a bad day. Because you can never truly know if someone\'s \'fine\' unless you trust them to tell you when something\'s wrong.\n\n', 'A Quantumn of Solace', , 'Tragic', 'Texas', 291);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(6, 2, 'I’m about to meet up with my ex-girlfriend. We broke up two weeks ago and I’m hoping to get back together with her. I restricted her freedom too much. I scheduled all our classes together. I always wanted to know where she was. It all started a year ago when she cheated on me. She called me immediately afterwards and confessed. But ever since then, anytime she’s away from me, I always imagine the worst. She goes out with friends and some of them are male. So it’s hard for me to not get suspicious. And if I get suspicious, she gets nervous. Which makes me even more suspicious.\r\n\r\n', 'Obsessive Compulsion\r\n', , 'Mischievious', 'Carolina', 210);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(7, 3, 'I’m obsessive, but my obsessions are productive. I’m happy. I never get depressed. I find life very interesting. I paint for hours every day. I have 100,000 postcards at home organized geographically. And I’ve written a thumbnail about every day of my life between 1981 and 2011. I have 20,000 pages of notes. Right now I’m in the editing phase. I’ll be done with that in a couple years, and then I’m going to copy the entire thing by hand. There\'s no way I can trust computers with something this important. I think I can finish the job in ten years. I’m pretty sure I can live long enough.\r\n\r\n', 'Orthodox Artist\r\n', , 'Traditional', 'Brookshire', 187);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(8, 3, 'The only time my mother spoke to us was when she was drunk. And she’d tell us we were unwanted. She convinced me to drink with her when I was ten. She told me that it would make me feel better. I started smoking crack when I was twelve. I never learned to read or write. I lost my entire childhood. My friends and I would break into cars, steal whatever we could, and use the money to buy more. It made me feel good and I wanted to feel good all the time. And nobody ever tried to stop me.\r\n\r\n', 'Abusive Relationships\r\n', , 'Tragic', 'Louisiana', 122);

